import './App.css';
import React, { useState } from 'react'

function App() {
  const [count, setCount] = useState(0);
  const plus =()=>{
setCount(count + 1)
  }
  return (
    <>
    <div className="App">
  <h1>Hello from react practice-app</h1>


  <h1>
<button onClick={plus}> + </button>

<p>clicked {count} times</p>
  </h1>

    </div>
    </>
  );
}

export default App;
